import React, {Component} from 'react';
import { Media, Container, Row, Col, Image } from 'react-bootstrap';
import FacebookIcon from '@material-ui/icons/Facebook';
import LinkedInIcon from '@material-ui/icons/LinkedIn';
import MailIcon from '@material-ui/icons/Mail';
import WhatsAppIcon from '@material-ui/icons/WhatsApp';

import './Styles.css'


class Contact extends Component{
    render() {
        return (
            <div >
                <section >                            
                <Container className="display">
                <h2 className='header' style={{textAlign:"center"}}>Contact</h2>
                    <Row>
                        <Col xs={{ order: 'first' }} >  
                            <Image width={220} height={200} 
                            src={require("../asserts/images/logo.jpg")} roundedCircle />            
                        </Col>
                        <Col  >
                        <p>If you are interested or have any question, you can contact me via </p>
                            <MailIcon style={{ fontSize: 40 }}/>
                            <LinkedInIcon style={{ fontSize: 40 }}/>
                            <WhatsAppIcon  style={{ fontSize: 40 }}/>
                            <FacebookIcon  style={{ fontSize: 40 }}/>

                        </Col>
                        <Col >              
                        </Col>
                    </Row>
                </Container>





                </section>
            </div>
        );
    }         
}

export default Contact;
